insert  into `bonus_bonus`(`id`,`category_id`,`name`,`score`,`max_times`,`illustrate`,`remark`,`created_at`,`created_by`,`updated_at`,`updated_by`,`deleted`) values (1,1,'基础成绩','0.00',0,'学生基础成绩导入','学生基础成绩导入',NULL,NULL,NULL,NULL,0),(2,2,'出版著作','5.00',99,'公开出版学术、文学、艺术等著作的','公开出版学术、文学、艺术等著作的',NULL,NULL,NULL,NULL,0),(3,2,'发表学术论文','1.00',99,'所有论文加分应有出版刊物作为证明材料，录用通知原则上不作为评分依据；不同论文按篇数累计加分；被转载的论文按转载最高级刊物计分。','发表科技学术论文的',NULL,NULL,NULL,NULL,0),(4,2,'科研与科技发明','1.00',99,'不同成果可累计加分，同一成果获不同级别奖励，只计最高分，不累加；集体合作成果排名前三者按相应项计满分，其他作者按相应项减半计分；课题主持者按相应项计满分，其他参与者按相应项减半计分，参与者不超过5人（含课题主持者）；参与课题申报和申报课题成功，只选一项加分。','参加科学研究和科技学术活动，取得科研成果获奖，或取得国家专利的',NULL,NULL,NULL,NULL,0),(5,2,'学科与文体竞赛','1.00',99,'不同项目获奖可累计加分，同一项目获不同等级奖，只计最高分，不累加；团体竞赛获奖，对其中起主要作用者，按相应项计满分，起次要作用者，按相应项减半计分。此类学科与文体竞赛包含学校教务处、校团委、创新创业学院所发布的竞赛活动，以及学院认定的各类学科竞赛（如数学建模竞赛、数学竞赛、程序设计竞赛（机器人、应用开发、ACM）、物联网竞赛、计算机作品大赛、大数据分析与挖掘竞赛等）','竞赛获奖',NULL,NULL,NULL,NULL,0),(6,2,'社会工作','1.00',99,'担任该职务不足一学期的，或不履行工作职责的，不予加分；兼任多项职务的，以可获得最高评分的一项职务考核计全分，第二项职务按相应职位分减半加分，多于两项职务不再加分。','在校、学院、班级担任学生干部或其他社会工作者，可视其责任大小和工作表现',NULL,NULL,NULL,NULL,0),(7,2,'社会活动','1.00',99,'积极参加社会实践活动，并撰写上交社会调查（实践）报告者，计1分。如被评为院级及以上先进集体、先进个人、积极分子，或者优秀社会调查（实践）报告者，因同一事迹受到不同级别表彰的，以最高级别表彰计分，不重复计分。 ','积极参加社会实践活动，并撰写上交社会调查（实践）报告者',NULL,NULL,NULL,NULL,0),(8,2,'发表文学、艺术、宣传报道等作品','1.00',99,'在合法媒体上（报刊应该具有CN刊号和国际标准号<ISSN号>、或有相关部门审批的内部准印号；网站应该是学校及其职能部门的门户网站）上发表文学、艺术、宣传报道等作品的','发表文学、艺术、宣传报道等作品',NULL,NULL,NULL,NULL,0),(9,2,'职业技能培训','1.00',99,'通过英语水平考试（CET、PETS、托福、雅思等）或其他语种语言水平考试、计算机水平考试、普通话水平测试；获得国家认可的职业资格证书。证书等级由各学院按照相关规定、结合证书获得的难易程度予以认定，同一项目以最高分计，不累计加分。','职业技能培训',NULL,NULL,NULL,NULL,0),(10,3,'院部统一加分申请','0.00',99,'院部通过外部文件统一导入加分分数','院部统一加分申请',NULL,NULL,NULL,NULL,0),(11,4,'院部统一惩戒申请','0.00',99,'院部通过外部文件统一导入惩戒分数','院部统一惩戒申请',NULL,NULL,NULL,NULL,0);

/*Table structure for table `bonus_category` */

DROP TABLE IF EXISTS `bonus_category`;

CREATE TABLE `bonus_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '综测加分类别(如:学习成绩、素拓成绩、实际与创新能力成绩)',
  `weights` decimal(6,2) DEFAULT '0.00' COMMENT '该类别所代表的权重(如:学习成绩占60%,素拓成绩占20%,实际与创新能力成绩占20%)',
  `created_at` datetime DEFAULT NULL COMMENT '创建记录时间',
  `created_by` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '记录创建人',
  `updated_at` datetime DEFAULT NULL COMMENT '更新记录时间',
  `updated_by` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '记录修改人',
  `deleted` int(11) DEFAULT NULL COMMENT '逻辑删除,0未删除,1已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='加分项类别表';

